    text-shadow: red 0 2px, cyan 0 -2px;
    transition: text-shadow 200ms;
    :hover{
        text-shadow: red -6px, cyan 6px 0;
    }
    
`;

const PageNotFound = () => (

  <>
		{/* Mensaje cuando llegue a p√°gina incorrecta */}
